import React from 'react';
import './App.css';
import './_css/list.css'
import './_css/detail.css'
import { BrowserRouter as Router, Route, Link } from "react-router-dom/modules/BrowserRouter";
import NewsList from "./pages/newsList";
import './css/components/badges.css'
import './css/tailwind.css'
import './css/components/buttons.css'
import NewsDetail from "./pages/newsDetail";
const App = () => {
  return <>
      <Router>
        <Link to="/newsList"> NEWS LIST </Link> <br/>
        <Link to="/newsDetail"> NEWS DETAIL </Link> <br/>
        <Route exact path='/newsList' component={NewsList}/>
        <Route exact path='/newsDetail' component={NewsDetail}/>
      </Router>
  </>
}

export default App;
